if (document.getElementById("extension_token").value != ""){
	document.getElementById("content").style.display = "none";
	document.getElementById("content_1").style.display = "block";
}
else{
	document.getElementById("content").style.display = "flex";
	document.getElementById("content_1").style.display = "none";
}

function save() {
    var valueToken = document.getElementById("extension_token").value;
    chrome.cookies.set({
        url: 'http://olympusenglish.azurewebsites.net/',
        name: 'extension_token',
        value: valueToken,
        expirationDate: (new Date().getTime() / 1000) + 315532800
    });
    document.getElementById("content").style.display = "none";
    document.getElementById("content_1").style.display = "block";
    document.getElementById('play').click();
}

function initExtension() {
    chrome.cookies.getAll({ url: "http://olympusenglish.azurewebsites.net" }, function(cookies) {
        var tempCookieValue = '';
        for (var i = 0; i < cookies.length; i++) {
            tempCookieValue += cookies[i].name + '=' + cookies[i].value + '; ';
        }
        if (tempCookieValue == '') {
            //Code hiển thị nút đăng nhập vào "http://olympusenglish.azurewebsites.net"
            //Nhấp vào nút thì open new tab để vào trang "http://olympusenglish.azurewebsites.net"

            //
        } else {
            const opts = {
                credentials: 'same-origin',
                headers: {
                    cookie: tempCookieValue
                }
            }
            fetch("https://uitenglishbot.herokuapp.com/verifyToken", opts)
                .then(function(res) {
                    console.log(tempCookieValue);
                    //Show Xin chào bạn tempCookieValue.Name
                    // Handle response you get from the server
                    if (tempCookieValue.Name === "undefined") {
                        //Code hiển thị nút đăng nhập vào "http://olympusenglish.azurewebsites.net"
                        //Nhấp vào nút thì open new tab để vào trang "http://olympusenglish.azurewebsites.net"
                    }
                });
        }
    });

}
